using System.Net.Sockets;

static class Program
{
    const string OurExe = "";

    static void Main(string[] args)
    {
        TcpClient tc = new TcpClient("localhost", 4444);
        var sw = new StreamWriter(tc.GetStream());
        sw.WriteLine(OurExe);
        sw.Close();
        tc.Close();
    }
}